        <thead>
            <tr>
                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>Password</th>
                <th>Baneado</th>
                <th>Nombre</th>
                <th>Acciones</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.password }}</td>
                <td>{{ user.baneado ? 'Yes' : 'No' }}</td>
                <td>{{ user.nombre }}</td>
                <td>
                    <a href=\"{{ path('app_user_crud_delete', {'id': user.id}) }}\">‚ùå</a>
                    <a href=\"{{ path('app_user_crud_edit', {'id': user.id}) }}\">‚úè</a>
                    <a href=\"{{ path('app_user_crud_show', {'id': user.id}) }}\">üëÅ</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"7\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
        <a href=\"{{ path('app_user_crud_new') }}\">Crear un usuario</a>
    </table>
{% endblock %}
